import styel from './Products.module.css'
import { useDispatch, useSelector } from 'react-redux'
import { useEffect } from 'react'
import {get} from '../feature/productSlice'

const Products = () => {
  const dispatch = useDispatch()


  useEffect(() => {
    dispatch(get())
  }, [])

  const state = useSelector(state => state.product.product)
  console.log(state);






  const data = []
  const map = state.map((ev, i) => (
    <div key={i}>
      <p>{ev.book}</p>
    </div>
  ))

  return (
    <div className={styel.body}>
      {state.length > 0 ?
        { map }
        :
        <p>There is no book here.</p>

      }
    </div>
  )
}
export default Products
